window.bookSummaryJSON = "<p><b>The joy of killing...</b> </p><p>The enemy’s plotting against them - while they’re tearing at each other’s throats! Malaria could lay them on their backs. Jungle fever threatens to strip their sanity. An army of death marches through bloody war zones looking to tear their guts out. But over the roar of grenades and the swish of Samurai swords you can always hear the spine-curdling battle cry of the guys who kill their way to victory.</p>"; 
